// File: components/PresaleSection.jsx

import React, { useEffect, useState } from 'react';

const PresaleSection = () => {
  const [timeLeft, setTimeLeft] = useState({});
  const [amount, setAmount] = useState(1);
  const [paymentMethod, setPaymentMethod] = useState('BNB');

  const pricePerToken = 0.00022;
  const listingPrice = 0.025;

  const targetDate = new Date("2025-05-08T00:00:00").getTime(); // Countdown ends here

  useEffect(() => {
    const interval = setInterval(() => {
      const now = new Date().getTime();
      const distance = targetDate - now;

      if (distance < 0) {
        clearInterval(interval);
        setTimeLeft({ days: 0, hours: 0, minutes: 0, seconds: 0 });
      } else {
        setTimeLeft({
          days: Math.floor(distance / (1000 * 60 * 60 * 24)),
          hours: Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60)),
          minutes: Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60)),
          seconds: Math.floor((distance % (1000 * 60)) / 1000)
        });
      }
    }, 1000);

    return () => clearInterval(interval);
  }, []);

  const tokensReceived = (amount / pricePerToken).toLocaleString();
  const profit = (amount / pricePerToken * listingPrice).toFixed(2);

  const paymentOptions = [
    { label: "BNB", icon: "/images/bnb-logo.png" },
    { label: "USDT", icon: "/images/usdt-logo.png" },
    { label: "CARD", icon: "/images/card.png" }
  ];

  return (
    <section className="bg-black text-white py-14 px-4 md:px-12 lg:px-24">
      <div className="text-center mb-10">
        <h2 className="text-4xl font-bold text-orange-500 mb-2">Phase 1</h2>
        <p className="text-sm text-gray-400">PRICE INCREASE IN</p>

        <div className="flex justify-center gap-6 text-2xl font-semibold mt-4">
          {["days", "hours", "minutes", "seconds"].map((unit) => (
            <div key={unit} className="text-center">
              <p>{timeLeft[unit] || 0}</p>
              <span className="text-sm text-gray-400 capitalize">{unit}</span>
            </div>
          ))}
        </div>
      </div>

      <div className="max-w-xl mx-auto bg-gray-900 p-6 rounded-3xl shadow-lg">
        <div className="flex items-center justify-center gap-2 mb-4">
          <img src="/images/fdr.png" alt="FDR" className="w-6 h-6" />
          <p className="text-sm">
            1 FDR = <span className="text-blue-400 font-semibold">$0.00022</span>
          </p>
          <span className="text-green-400 text-sm">+10% Next Price</span>
        </div>

        <p className="text-center text-sm text-gray-400 mb-4">Listing FDR = $0.025</p>

        <div className="h-2 rounded-full bg-gray-700 relative mb-6">
          <div className="w-1/2 bg-gradient-to-r from-orange-500 to-purple-600 h-full rounded-full relative">
            <img src="/images/fdr.png" alt="FDR" className="absolute -top-3 -right-3 w-6 h-6" />
          </div>
        </div>

        <p className="text-white font-bold mb-2">Step 1 – Select the payment method</p>
        <div className="flex flex-wrap justify-between gap-3 mb-6">
          {paymentOptions.map(({ label, icon }) => (
            <button
              key={label}
              onClick={() => setPaymentMethod(label)}
              className={`flex-1 bg-gray-800 hover:scale-105 transition-transform text-white py-2 rounded flex justify-center items-center gap-2 ${
                paymentMethod === label ? 'border-2 border-orange-500' : ''
              }`}
            >
              <img src={icon} className="w-6 h-6" alt={label} />
              {label}
            </button>
          ))}
        </div>

        <p className="text-white font-bold mb-2">Step 2 – Enter the amount of token you would like to purchase</p>
        <div className="flex items-center mb-4">
          <input
            type="number"
            className="w-1/2 p-2 rounded bg-gray-800 text-white mr-2"
            value={amount}
            onChange={(e) => setAmount(Number(e.target.value))}
            min="1"
          />
          <div className="bg-gray-800 px-4 py-2 rounded flex items-center gap-2">
            <img src={`/images/${paymentMethod.toLowerCase()}-logo.png`} className="w-6 h-6" alt={paymentMethod} />
            {paymentMethod}
          </div>
        </div>

        <div className="flex items-center justify-center gap-2 mb-4">
          <p className="text-white text-sm">=</p>
          <p className="text-orange-400 text-sm font-bold">{tokensReceived}</p>
          <img src="/images/fdr.png" className="w-5 h-5" alt="FDR" />
          <span className="text-white text-sm">FDR</span>
        </div>

        <p className="text-center text-green-400 text-sm mb-6">
          Potential Profit: <strong>${profit}</strong><br />
          <span className="text-gray-400 text-xs">*Based on listing price of $0.025. Not guaranteed.</span>
        </p>

        <button className="w-full bg-gradient-to-r from-orange-500 to-pink-500 hover:scale-105 transition-transform text-white py-3 text-lg font-bold rounded">
          Buy Token
        </button>
      </div>
    </section>
  );
};

export default PresaleSection;
